import John from "./john";


let red="red"
let yel="yellow"
let on="ON"
let of="OFF"
function Johnny(){
    return(
        <div>
            <h1>Prakashraj</h1>
            <John red={red} yel={yel} on={on} off={of}/>
        </div>
    )
}

export default Johnny;
